register.text:
switch (moduleName) {
            case MODULE_COMMENT:
                url = COMMENT_API_URL;
                break;
            case MODULE_CONTENT:
                url = CONTENT_API_URL;
                break;
            case MODULE_MANAGE:
                url = MANAGE_API_URL;
                break;
            case MODULE_PAYMENT:
                url = PAYMENT_API_URL;
                break;
            case MODULE_SEARCH:
                url = SEARCH_API_URL;
                break;
            case MODULE_USER:
                url = USER_API_URL;
                break;
            default:
                break;
        }
